import React,{Component} from 'react';
import 'tachyons';
import Nav from './Nav';
import './App.css';
import Home from './home.js';
import Work from './work.js';
import Contact from './contact.js';
//import Contact from './contact.js';


class App extends Component {
  constructor() {
    super();
  this.state={
    route:'home'
  }}
  render(){
  const{route} = this.state;
    return (
      <div>
      <Nav/>
     {
         route === 'home'
       ?  <div>
          <Home/>
       </div>:
         <Work/>
     }
    </div>
    );
  }
}

export default App;
